import React, { useState } from 'react';
import { BrowserRouter as Router, Routes, Route, Link, Navigate } from 'react-router-dom';
import Home from './pages/Home';
import Login from './pages/Login';
import Register from './pages/Register';
import Dashboard from './pages/Dashboard';

function App() {
  const [isLoggedIn, setIsLoggedIn] = useState(false);

  return (
    <Router>
      <div>
        <nav style={{ background: '#005792', padding: '10px', color: 'white', display: 'flex', justifyContent: 'space-between' }}>
          <span style={{ fontWeight: 'bold', fontSize: '18px' }}>
            üè° Green Valley Community
          </span>
          <div>
            <Link to="/" style={{ color: 'white', marginRight: '15px' }}>Home</Link>
            {isLoggedIn ? (
              <Link to="/dashboard" style={{ color: 'white', marginRight: '15px' }}>Dashboard</Link>
            ) : (
              <>
                <Link to="/login" style={{ color: 'white', marginRight: '15px' }}>Login</Link>
                <Link to="/register" style={{ color: 'white' }}>Sign Up</Link>
              </>
            )}
          </div>
        </nav>

        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/login" element={<Login onLogin={() => setIsLoggedIn(true)} />} />
          <Route path="/register" element={<Register />} />
          <Route path="/dashboard" element={isLoggedIn ? <Dashboard /> : <Navigate to="/login" />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
